import React, {useContext} from 'react'
import classes from './header.module.css'
import { ThemeContext } from '../../hoc/darkmode/themeContext'
//components
import Navigation from './navigation/navigation'

const Header = () => {
  const {theme} = useContext(ThemeContext);
  return (
    <>
        <header className={theme ? classes.Header : classes.Header+ " " + "dark"}>
            <div className={theme ? classes.con : classes.con+ " " + "dark"}>

                <nav className={theme ? classes.Nav : classes.Nav+ " " + "dark"}>
                    <Navigation />
                </nav>
            </div>
        </header>
    </>
  )
}

export default Header
